var $bm_rt;
var xo, yo, ax, ay, fx, fy, t, x, y;
xo = value[0];
yo = value[1];
ax = 10;
ay = 3;
fx = 0.2;
fy = 0.2;
t = $bm_sub(time, inPoint);
x = $bm_sum($bm_mul(Math.sin($bm_mul($bm_mul($bm_mul(t, Math.PI), 2), fx)), ax), xo);
y = $bm_sum($bm_mul(Math.cos($bm_mul($bm_mul($bm_mul(t, Math.PI), 2), fy)), ay), yo);
$bm_rt = [
    x,
    y
];

